interface Props {

}


export const BookingRouter:  React.FC<Props> = () => {
    const {data, loading, error} = useMyBookingQuery()

    const listener = (booking: any) =>{
        console.log(booking)
    }


    if(loading){
        return <div>
            loading ....
        </div>
    }

    if(error){
        console.log(error)
        return <div>err</div>
    }

    if(!data){
        return <div>
            no data
        </div>
    }



    return (
        <div>
            <MyBooking listener={listener} mybooking={data} ></MyBooking>
            <PropertyList></PropertyList>
        </div>
    )

}
